import React from "react";
import FraudIp from "./FraudIp";
import { useState, useEffect } from "react";
import DisplayIpData from "./DisplayIpData";

// const getIpData = async () => {
//   return response.data;
// };

function App() {
  const [ipData, setIpData] = useState({});

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    const response = await FraudIp();
    console.log("response ", response);
    setIpData(response);
  };

  return (
    <div>
      <div>
        <table cellpadding="0" cellspacing="0" border="0" width="100%">
          <tr bgcolor="#161616">
            <td width="20" height="64">
              {" "}
            </td>
            <td width="480" height="64" valign="middle" align="left">
              <p style="color: #FFFFFF; font-size: 20px; text-align:center">
                Welcome
              </p>
            </td>
          </tr>
        </table>
      </div>
      {Object.entries(ipData).map((data) => (
        // <h1 key={data[0]}>{data[1].host}</h1>
        <DisplayIpData key={data[0]} data={data[1]} />
      ))}
    </div>
  );
}

export default App;
